import React from 'react';

function DietObesity1() {
  return (
    <div className="diet-page">
      <h1>Diet for Obesity Level 1</h1>
      <p>For Obesity Level 1, a more controlled diet plan is recommended:</p>
      <ul>
        <li>Focus on low-calorie, high-nutrient foods like leafy greens and berries.</li>
        <li>Opt for lean protein sources and limit saturated fats.</li>
        <li>Include whole grains and legumes in your meals.</li>
        <li>Monitor caloric intake and portion sizes.</li>
        <li>Regular physical activity is crucial, along with regular consultations with a healthcare provider.</li>
      </ul>
    </div>
  );
}

export default DietObesity1;
